import React from 'react'

import BadgeProfil from './BadgeProfil'
import ListeFollow from './ListeFollow'

class NavSide extends React.Component {
    render () {
        return <div className='MainNav'>
            <BadgeProfil />
            <h4>Utilisateurs Follow</h4>
            <ListeFollow />            
            </div>
    }
}

export default NavSide
